import { useEffect } from "react"

const useFecth  = () =>{

    useEffect(() =>{

        const options = {
            method: 'GET',
            headers: {
                'X-RapidAPI-Key': 'caeb44112amsh2fda6a93504a91bp1345acjsn863be33044dd',
                'X-RapidAPI-Host': 'imdb8.p.rapidapi.com'
            }
        };

        fetch('https://imdb8.p.rapidapi.com/title/find?q=rrr', options)
            .then(response => response.json())
            .then(response => console.log(response))
            .catch(err => console.error(err));
    })
}

export default useFecth;
